deck_description:
Well, the easiest way to explain it is that you keep XYZ summon Monsters Using Constellars Monsters which are amazing for that because They can give you Rank 4,5,6 XYZ Constellars very fast. Also, You can easily keep your hand full of Constellars monsters. I Guess you could also Benefits from all Constellars XYZ Effects, Which Are:

Constellar Omega (Rank 4): Your Constellar Monsters aren't affected by your opponent spell or trap card till the end of either players turn.

&nbsp;

Constellar Praesepe (Rank 4): One Constellar monster gains 1000 Attack points, During either player turn, Till the end of that turn.

&nbsp;

Constellar Pleiades (Rank 5): Return one card on the field to its controller hand, during either player turn.

&nbsp;

Constellar Ptolemy M7 (Rank 6): You can XYZ this Monsters by using any XYZ  Constellar Monster you control as the XYZ material. Only during your turn, You can return one monster card from either player field or graveyard to its Owner Hand.-----------------------------------------------------------------

&nbsp;

You may be asking "What the hell is umbral have to do in this deck?!" Well, the answer is a simple Trap Card Called "Corrupted Keys" Which Allow you To target An XYZ monster you control and summon Three Umbral Tokens (ATK:??,DEF:00) its attack is the attack of your XYZ Monster. They can't attack your opponent directly.

&nbsp;

You can use them to clean your opponent field of Monsters then attack directly with you XYZ Monster. Or you can easily tribute them to summon a high level Monster (Like An Egyptian God monster for example).

&nbsp;

This deck also has A variety of spell cards especially for this archetype.

&nbsp;

So, I was very, very surprised (and Angry) to notice that no one seems to use this amazing Archetype. With a little tweak here and there I made this deck very powerful.

&nbsp;

If anyone have anything to say (Good or bad) about this deck, please write. It will only help me make it much better.

You've got 3 Super Quants in Red Layer, Blue Layer, and Green Layer. Each of the layers do something when they're summoned, and when they go to the Graveyard

The archetype's main goal is to rapidly summon its Xyz Monsters and then use their effects to disrupt the opponent's field. The archetype also focuses on the use of its 3 main monsters as an easy way to search out its resources from the Deck or recycle them from the Graveyard, enabling repetitive looping of Xyz Summons to further field advantage.

&nbsp;

&nbsp;

wind witch = synchron dragon

&nbsp;

other cards = ultimaya or cyber dragon

summon any high attack gladiator beast monster (lvl 4) then attack and kill a monster or survive an attack from a monster, special summon gladiator beast augustus in attack pos then place down a pyramid of light and special summon the andro card and at some point when your enemy has high level cards tribute summon the grand jupiter, discard 2 cards from your hand and then add there attack to your own attack. AND WIN!!

&nbsp;

ps. this deck does not include synchro, xyz, pendulum and only ONE fusion card

A Legendary Ocean GOAT Format deck. Focuses on WATER based monsters.

The power of WATER!

